
package proteins

import org.scalatest.{Matchers, FlatSpec}

class ProteinTranslationSpec extends FlatSpec with Matchers {

  "DNA" should "be translated to Protein_example" in {
    val input:RNA = new RNA("AUGGCCAUGGCGCCCAGAACUGAGAUCAAUAGUACCCGUAUUAACGGGUGA")

    assertResult("MAMAPRTEINSTRING")(input.toProteinString())
  }


  "DNA" should "be translated to Protein_testCase" in {
    val input:RNA = new RNA("")
    val output:String = input.toProteinString()

    assertResult("")(output)
  }

}
